import React from 'react';
import './CarGrid.css';

const cars = [
  { id: 1, name: 'Toyota Camry', price: '$50/day', image: 'https://via.placeholder.com/200x120?text=Toyota+Camry' },
  { id: 2, name: 'Honda Accord', price: '$55/day', image: 'https://via.placeholder.com/200x120?text=Honda+Accord' },
  { id: 3, name: 'Ford Mustang', price: '$80/day', image: 'https://via.placeholder.com/200x120?text=Ford+Mustang' },
  { id: 4, name: 'Chevrolet Malibu', price: '$60/day', image: 'https://via.placeholder.com/200x120?text=Chevrolet+Malibu' },
  { id: 5, name: 'BMW 3 Series', price: '$90/day', image: 'https://via.placeholder.com/200x120?text=BMW+3+Series' },
  { id: 6, name: 'Audi A4', price: '$95/day', image: 'https://via.placeholder.com/200x120?text=Audi+A4' },
];

function CarGrid({ searchQuery }) {
  const filteredCars = cars.filter(car =>
    car.name.toLowerCase().includes(searchQuery.toLowerCase())
  );

  return (
    <div className="car-grid">
      {filteredCars.map(car => (
        <div key={car.id} className="car-card">
          <img src={car.image} alt={car.name} />
          <h3>{car.name}</h3>
          <p>{car.price}</p>
        </div>
      ))}
      {filteredCars.length === 0 && <p>No cars found.</p>}
    </div>
  );
}

export default CarGrid;
